You can configure a template by providing a .architect.json file. The format of its content is described here using TypeScript, the root object is modelled as the Config interface. /** * The configuration used by Architect when creating an instance of this project template. * * Everything (including the file itself) is optional, but Architect makes more sense to * use when actually configured */
export interface Config { /** * The name of the template. * * Can be used in handlebars templates using `__template__.name` */ name?: string; /** * The version of the template. * * Can be used in handlebars templates using `__template__.version` */ version?: string; /** * Questions to ask the user to specify dynamic context values. * * These values are then available in handlebars templates */ questions?: Question[]; /** * Specifies conditions for certain files to be created. * * These conditions have full access to the context that is created by the questions. * * Note that conditions specified here don't apply to hidden files that weren't explicitly * included using `includeHidden` or files excluded using `exclude` */ conditionalFiles?: ConditionalFiles[]; /** * Specifies Glob expressions to include hidden files in the target. * * Note that including the `.git` directory here will have no effect */ includeHidden?: string[]; /** * Specifies Glob expressions to exclude files in the target. * * Note that exclusions have a higher precedence than inclusions and conditional files */ exclude?: string[]; /** * Indicates whether to treat explicitly identified Handlebars templates (using their * file extension) as regular templates and render them. * * By default, Handlebars templates that are explicitly identified are not rendered, * rather they are copied as is. * * Note: File names of such files are still treated as templates */ renderHbs?: boolean; /** * The extension that is used to explicitly identify Handlebars templates. * * This is specified as a string preceded by a singular dot. The default value is `.hbs` */ hbsExtension?: string;
} export type Question = SimpleQuestion | SelectionQuestion; export interface SimpleQuestion extends BaseQuestion { type: QuestionType.Identifier | QuestionType.Option | QuestionType.Text;
} export interface SelectionQuestion extends BaseQuestion { type: QuestionType.Selection; /** * The items available for selection. * * These will be set to `true` in the context if selected. * * Format: `^[a-zA-Z_$][a-zA-Z0-9_$]*$` */ items: string[]; /** * Specifies whether multiple items can be selected */ multi?: boolean;
} export interface ConditionalFiles { /** * The condition that decides whether the matched files are created. * * This is an expression that is handled by handlebars. * * The expression is automatically wrapped in curly braces (`{{` `}}`) so you * only need to specify the actual content of the expression here */ condition: string; /** * A Glob string specifying the files affected by the condition */ matcher: string;
} interface BaseQuestion { /** * The name in the context for the value specified when answering this question. * * Can be multiple names concatenated using `.` to create hierarchical structures in * the context. * * Format: `^[a-zA-Z_$][a-zA-Z0-9_$]*$` */ name: string; /** * The type of the question, which indicates the expected values */ type: QuestionType; /** * A properly spelled out question to ask instead of just presenting the name when * processing input */ pretty?: string;
} export enum QuestionType { Identifier = 'Identifier', Option = 'Option', Selection = 'Selection', Text = 'Text'
}

