By default, Architect provides the following data in the context, provided values are configured: { "__template__": { "name": "The template name from in .architect.json or undefined", "version": "The template version from .architect.json or undefined" }
} You cannot add to the __template__ object using your questions, and Architect will reject any attempt to do so. However, you can still define a __template__ object in any nested object further down the line. Something like this would be possible: { "__template__": ..., "yourOwnObject": { "__template__": { "yourProperty": "some data" } }
}

