Architect will only include matched files if the specified condition returns a "truthy" result. Here, ordering matters, as Architect will only evaluate the condition for the first match. Here you define glob expressions to match files, and Handlebars expressions to determine whether these files should be included. These Handlebars expression don't need to be delimited by {{ and }}, and have full access to the context. The glob expression will be applied to the file in the source repository, so before any possible Handlebars templates in file or directory names are evaluated. Please keep in mind that when working with hidden files conditions can only be applied to files included using includeHidden. Format in the configuration file: // Config conditionalFiles?: ConditionalFiles[]; // ConditionalFiles
export interface ConditionalFiles { /** * The condition that decides whether the matched files are created. * * This is an expression that is handled by handlebars. * * The expression is automatically wrapped in curly braces (`{{` `}}`) so you * only need to specify the actual content of the expression here */ condition: string; /** * A Glob string specifying the files affected by the condition */ matcher: string;
}
